-- MODELO
CREATE TABLE IF NOT EXISTS `titanes` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `nombre` VARCHAR(255) NULL DEFAULT NULL,
  `altura` INT(11) NOT NULL, 
  PRIMARY KEY (`id`)
);

CREATE TABLE IF NOT EXISTS `recursos` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `nombre` VARCHAR(255) NOT NULL,
  `unidad` VARCHAR(255) NOT NULL, 
  PRIMARY KEY (`id`)
);

CREATE TABLE IF NOT EXISTS `movimientos` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `nombre` VARCHAR(255) NOT NULL,
  PRIMARY KEY (`id`)
);

CREATE TABLE IF NOT EXISTS `avistamientos` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `id_titan` INT(11) NOT NULL,
  `fecha` DATE NOT NULL, 
  PRIMARY KEY (`id`),
  CONSTRAINT `avistamiento_id_titan` FOREIGN KEY (`id_titan`) REFERENCES `titanes` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
);

CREATE TABLE IF NOT EXISTS `muertes` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `id_titan` INT(11) NOT NULL,
  `causa` TEXT NOT NULL,
  `fecha` DATE NOT NULL, 
  PRIMARY KEY (`id`),
  CONSTRAINT `muertes_id_titan` FOREIGN KEY (`id_titan`) REFERENCES `titanes` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
);

CREATE TABLE IF NOT EXISTS `movimientos_recursos` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `id_recurso` INT(11) NOT NULL,
  `id_movimiento` INT(11) NOT NULL,
  `id_muerte` INT(11) NULL DEFAULT NULL,
  `cantidad` INT(11) NOT NULL,
  PRIMARY KEY (`id`),
  CONSTRAINT `movimientos_recursos_id_recurso` FOREIGN KEY (`id_recurso`) REFERENCES `recursos` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `movimientos_recursos_id_movimiento` FOREIGN KEY (`id_movimiento`) REFERENCES `movimientos` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `movimientos_recursos_id_muerte` FOREIGN KEY (`id_muerte`) REFERENCES `muertes` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
);

